import React from "react";

export default function Data() {
  let pokemon = ["hamza", "s8", "amin"];

  const ptag = pokemon.map((name, index) => (
    <p key={index}>{name}</p>
  ));

  return (
    <div>
      [
        {ptag}
      ]
    </div>
  );
}
